import React, { useState } from 'react'

function Inventory() {
    const items = [
        {
          name: 'Item 1',
          lvl: 5,
          damage: 30,
          scaling: 0.5,
          scalingType: 'Physical',
          requirements: 'Strength 20, Dexterity 15',
          effect: 'Increases attack power.',
        },

        {
          name: 'Item 1',
          lvl: 5,
          damage: 30,
          scaling: 0.5,
          scalingType: 'Physical',
          requirements: 'Strength 20, Dexterity 15',
          effect: 'Increases attack power.',
        },
        {
          name: 'Item 1',
          lvl: 5,
          damage: 30,
          scaling: 0.5,
          scalingType: 'Physical',
          requirements: 'Strength 20, Dexterity 15',
          effect: 'Increases attack power.',
        },
        {
          name: 'Item 2',
          lvl: 8,
          damage: 50,
          scaling: 1.2,
          scalingType: 'Magical',
          requirements: 'Intelligence 25',
          effect: 'Boosts magical abilities.',
        },
      
      ];
      const [amounts, setAmounts] = useState({
        amount1: 1215,
        amount2: 0,
        amount3: 0,
      });
      const [inputMode, setInputMode] = useState(false);
      const handleAmountClick = () => {
        setInputMode((prevInputMode) => !prevInputMode);
      };
      const handleChange = (event) => {
        const { name, value } = event.target;
        setAmounts((prevAmounts) => ({
          ...prevAmounts,
          [name]: parseInt(value) || 0,
        }));
      };
      return (
        <div className=" h-auto bg-[#D6E6F6] flex">
   <div className=' bg-[#263895] m-auto w-[85%] mt-[2%] rounded-[2%] mb-[5%]   h-[1700px]'>
   <div className='bg-[#798EC8] m-[2%] h-[93%] rounded-[2%]   '>
    <div className='flex h-[8%] justify-between'>
   <h1 className=" text-7xl p-[1%]">Inventory </h1>
   <input
      type="search "
      className=' rounded-3xl h-[20%] w-[23%] m-[2%] pl-[1%] text-xl bg-[#D6E6F6] text-[black] placeholder:text-[black] font-semibold  '
      placeholder="Search .."
     />
 
      </div>
      <div className=' flex h-[5%] gap-3 ml-[2%]'>
      <div className='dot2 h-[50%]'></div>
      {inputMode ? (
     
              <input
                type="text"
                className=" text-3xl h-[50%] w-[4%]   inputNoStyles   "
                value={amounts}
                onChange={handleChange}
                onBlur={handleAmountClick}
              />
            ) : (
              <div className="text-3xl   cursor-pointer" onClick={()=>setAmounts(amounts.amount1-1)} onDoubleClick={handleAmountClick}>
               
                {amounts}
              </div>
            )}
      <div className='dot2 h-[50%]'></div>
      {inputMode ? (
     
     <input
       type="text"
       className=" text-3xl h-[50%] w-[4%]   inputNoStyles   "
       value={amounts}
       onChange={handleChange}
       onBlur={handleAmountClick}
     />
   ) : (
     <div className="text-3xl h-[50%] w-[4%]   cursor-pointer" onClick={()=>setAmounts(amounts.amount2-1)} onDoubleClick={handleAmountClick}>
      
       {amounts}
     </div>
   )}
      <div className='dot2 h-[50%]'></div>
      {inputMode ? (
     
     <input
       type="text"
       className=" text-3xl h-[50%] w-[4%]   inputNoStyles   "
       value={amounts}
       onChange={handleChange}
       onBlur={handleAmountClick}
     />
   ) : (
     <div className="text-3xl h-[50%] w-[4%]   cursor-pointer" onClick={()=>setAmounts(amounts.amount3-1)} onDoubleClick={handleAmountClick}>
      
       {amounts}
     </div>
   )}
      </div>
      
      <div class="inventory pl-[3%]">
  <div class="px-4 py-2 text-xl">Name</div>
  <div class=" px-4 py-2 text-xl">Amount</div>
  <div class=" px-4 py-2 text-xl">Effect</div>
  
</div>
<div className="overflow-scroll h-[75%] overflow-x-hidden scrollbar">
{items.map((item, index) => (
            <div key={index} className="inventory  pl-[3%]  ">
              <div className="px-4 py-2 text-xl">{item.name}</div>
              <div className="px-4 py-2 text-xl">{item.lvl}</div>
              <div className="px-4 py-2 text-xl">{item.damage}</div>
              
            </div>
          ))}
        
        </div>
   </div>
   </div>
    </div>
      );
    }
  


export default Inventory
